column17:
The following post uses a distract tactic:

@rovercrc As per #CZ bullrun will start from china and #OggyInu is focusing there do you got the connection? @OggyInuBrand 👊

This post is discussing a completely different and irrelevant topic of a potential bullrun starting from China and focusing on a cryptocurrency called #OggyInu. This is a distract tactic because it shifts the focus away from the main topic of insurgent threats to cryptocurrency investment opportunities. By introducing this unrelated topic, the post aims to divert attention from the original subject matter.
